import Navbar from '../components/Navbar'
import './Rooms.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPlusCircle } from '@fortawesome/free-solid-svg-icons'

function Rooms() {
  return (
    <div className="rooms-container">
      <Navbar />
        <nav className="rooms-navbar">
            <ul className="rooms-list">
                <li><a href="/rooms" className="rooms-private" id='private'>Your Rooms</a></li>
                <li><a href="/roomspublic" className="rooms-public">Public Rooms</a></li>
            </ul>
        </nav>
        <div className="rooms-list">
            <div className="create-room">
                <button><FontAwesomeIcon icon={faPlusCircle} /> Create a room</button>
            </div>
        </div>
    </div>

  );
}

export default Rooms;
